export default function Header(props) {
  return (
    <header className="header">
      <nav className="nav" role="navigation" aria-label="main navigation">
        <Link href="/">{props.siteTitle}</Link>
        <Link href="/">About me</Link>
      </nav>
    </header>
  )
}
